import React from 'react';
import { ConnectedRouter } from 'connected-react-router';
import Routes from '../infrastructure/routes/Routes';

import "./styles/style.scss";

function App() {
  return (
    <ConnectedRouter>
      <Routes />
    </ConnectedRouter>
  );
}

export default App;
